INSERT INTO `brand_tb` VALUES (1,'LOOKS & MEII GLOBAL','http://www.looksnmeiiglobal.com/','LOOKS & MEII\n- The classy beauty brand\n\nLOOKS & MEII Cosmetics\n\n“Inner and outer beauty that coexists beautifully for all”\n\nLooks & Meii Cosmetics strongly believe that the true beauty is created from both inside and outside. \nSatisfying outlook will give confidence and positive energy for all. \nWe prioritize authentic beauty with careful research and analysis for all skin types.\n\nAs Looks & Meii value our products to be safe and trust-worthy, our team’s Beautyologists research countlessly and explore worldwide to find the best ingredients for our products. \nWe value honesty and sincerity the most for all our products. \nExpanding our worldwide research and high-technology skills to find the best and new formulas definitely support our products’ great quality.\n\nWe keep up to date with new beauty trends while staying classy to balance both to create a healthy and beautiful look. \nAll our products are carefully curated and supervised to fit for all skin types. \nWe also value the upcoming trends with beauty influencers and collaborative creators for our products to stay classy with creative & modern design/look.\n\nOur company is located in New York, U.S. \nAlso has an office in Seoul, South Korea and Shanghai, China. \nAs we are located in the most influential and stylish cities in the world, Looks & Meii is confident that our products are trust-worthy and can help all skin types to become healthier and beautiful. \nOur goal is to provide the best product for all to balance their inner and outer beauty.','https://looksnmeiiusa.com/pages/about-us','/files/brand/logo/looksnmeii.png','/files/brand/mainimage/looksnmeii_main.jpg','https://www.youtube.com/channel/UCYWqfoIkPyC1VDcMZaordVw','https://www.instagram.com/looksnmeii_official/','https://www.facebook.com/%EB%A3%A9%EC%8A%A4%EC%95%A4%EB%A9%94%EC%9D%B4-%EC%BD%94%EC%8A%A4%EB%A9%94%ED%8B%B1-107114260775735/',1,1,'2020-10-13 10:50:05','2020-10-13 10:50:05'),(2,'KimJeongMoon ALOE','http://www.kjmaloe.com/','KimJeongMoon ALOE\n- First ALOE Love, To Be Life Love\n\nCORPORATE PHILOSOPHY\n\nKim Jung Moon-ism\n\n\"\"Naturalness\"\" refers to the fact that the mind and body do not get sick,\nbut maintain balance in a circular state.\nHere round means natural state.\nHumans are a part of nature, and when they are far from nature, balance (naturalness) is broken and sick\nThis can not be an exception to society.\nSo restoring the originality of the original form is a fundamental way to make people happy.\nWe call humanitys lost natural revival movement \"\"Kim Jungmun-ism\"\" and practice true love for humanity through it.\n\nNaturalism\n\nNature is the best condition in which human beings can lead the most human life, and it is Kim Jeong Moon Alloes belief that humans can restore nature through studying nature and using results.\n\nRespect for human\n\nHuman beings are an infinite source of business activity and an end purpose.\nIt is the task of the management of the company to provide the conditions for the members to show their individuality, creativity and potential.\n\nSocial contribution\n\nKim Jeong-moon Aloe constantly examines the effects of business activities on society and the environment and finds ways to return corporate profits to society as much as possible.\n\nTruth\n\n「True and honest practice」\n\"\"True\"\" means \"\"water is straight and conscientious in response to universal truth,\"\" and \"\"honest practice\"\" is a move with great trust and dignity, with a pioneering attitude.\n\n\nCompanies contributing to human health through natural restoration\n\n\"\"Naturalness\"\" refers to the fact that the mind and body do not get sick, but maintain balance in a circular state\nHere round means natural state.\nHumans are a part of nature, and when they are far from nature, balance (naturalness) is broken and sick\nThis can not be an exception to society.\nSo restoring the originality of the original form is a fundamental way to make people happy.\nWe call humanitys lost natural revival movement \"\"Kim Jungmun-ism\"\" and practice true love for humanity through it.\n\n\nNatural Health Culture Company\n\nNature is the best condition for man to lead the most human life,\nIt is Kim Jeong-Moons belief that human beings can restore their naturalness through research on nature and the use of the results.\n\nKim Jung Moon Aloe is a business area that ultimately restores naturalness and delivers true health and related culture and values to humanity. ','http://www.kjmaloe.com/comp_history.do','/files/brand/logo/kimjeongmoon.jpg','/files/brand/mainimage/kimjeongmoon_main.jpg','https://www.youtube.com/channel/UCj8jVA_dwY0zFkmq6SLZ5qQ','https://www.instagram.com/cure.official/','https://www.facebook.com/CURE-1480606948717838/',1,1,'2020-10-13 12:27:00','2020-10-13 12:27:00'),(3,'COSRX','https://www.cosrx.com/','COSRX\n\nPress\n\nThis snail mucin skincare product sells every 20 seconds in the UK\nCOSRX’s Advanced Snail 96 Mucin Power Essence promises to boost the skin’s glow, improve its texture and reduce any signs of ageing.\n\n12 Face Mists To Try If Youre Feeling The Heat\nAhh, CosRX, the creators of our favorite pimple patches and snail mucin essence. If you are looking for a simple, limited ingredient and soothing face mist, the CosRX Centella Water Alcohol Free Toner is the one for you.\n\nThis Lightweight Moisturizer Has Healed My Blotchy Summer Skin\nIt’s no secret that Cosrx makes some of my most tried and true skin-care products — its Snail Mucin Essence and AHA Whitehead Power Liquid have remained staples in my routine for years.\n\nCould SNAIL SLIME give you glowing skin? Emily Ratajkowski swears by this $19 mucin essence that promises to help create a soft dewy complexion\nSnail mucin (aka snail slime), the external bodily mucus produced by snails, is a skincare ingredient - and a beneficial one at that.\n\nWhat Our Editors Are Buying From Dermstores Anniversary Sale 2020\nDermstore, known for its selection of skin care and makeup products, just launched its 21st Anniversary Sale, which means you can save up to 25% on select beauty brands through Aug. 17 when you use code CELEBRATE at checkout. The discount depends on the product, and prices are marked as is.\n\nEmily Ratajkowski Swears By This Niche K-Beauty Ingredient For Stressed Skin\nThe snail product she showed off was by Cosrx, a Korean beauty brand that has a string of formulas featuring snail slime.\n\nThese Affordable Pimple Patches Are Working Wonders on My Stressed Skin\nCosrx’s Pimple Patches. Since my usual combo of acids and creams weren’t doing enough, I wanted to treat each spot directly, giving my skin the most targeted treatment available outside of a derm appointment.\n\nCosrx Snail Cream Is the Only Product You Need to Hydrate, Smoothe, and Brighten Skin\nUnless you’re a beauty fanatic, skincare is the last thing that comes to mind when someone mentions snails.\n\n8 skincare products James Welsh swears by\nThe skincare enthusiast and YouTuber is known for his honest reviews, in fact he told us his ultimate goal is to review every skincare product going (which might take some time).\n\nThe 12 COSRX Products Every Skin-Care Fiend Should Have\nIt’s wild to think that just as recently as three years ago, COSRX — the hugely popular Seoul-based brand now sold in Urban Outfitters, Ulta, and Ricky’s — was known only by U.S.–based skin-care sleuths (the folks like me who lurked around the r/Asian beauty subreddits, YouTube, and blogs like Fiddy Shades of Snail).\n\nThe Best Skincare Products To Try From COSRX\nEvery time we run a skincare survey on Cosmo Mixers (our fun Facebook group which you should totally join), Cosmo Girls never fail to mention that theyre using a COSRX product. In our kikay conversations with friends, this K-beauty brand is always top of mind, too! In the name of ~beauty~, we just had to investigate. Here are some reasons Pinays love COSRX products so much.','https://www.cosrx.com/cosrx-press','/files/brand/logo/cosrx_logo.svg','https://www.cosrx.com/media/wysiwyg/Event/Clearance/1006_clearance_bnr_pc.jpg','https://www.youtube.com/channel/UC8_qETGWRNIH01-QEjWYBKw','https://www.instagram.com/cosrx/','https://www.facebook.com/OfficialCOSRXGlobal/',1,1,'2020-10-13 12:43:10','2020-10-13 12:43:10'),(4,'Dr. G','https://www.dr-g.co.kr/','the brand that brings those dreams together.\r\nThe right solution to skin problems, Dr.G','https://www.dr-g.co.kr/shop/about/story.php','https://www.dr-g.co.kr/shop/data/skin/standard_C/images/common/logo.png','/files/brand/mainimage/drg_main.jpg','https://www.youtube.com/user/DRGKOREA','https://www.instagram.com/dr.g_official/','https://www.facebook.com/gwsscosmetic',1,1,'2020-10-13 12:59:10','2020-10-13 12:59:10'),(5,'beplain','','','','','','','','',1,2,'2020-11-02 04:52:30','2020-11-02 04:52:30'),(6,'innisfree','','','','','','','','',1,2,'2020-11-02 06:34:41','2020-11-02 06:34:41'),(7,'9wishes','','','','','','','','',1,2,'2020-11-02 07:15:45','2020-11-02 07:15:45'),(8,'Pyunkang Yul','','','','','','','','',1,2,'2020-11-02 07:23:00','2020-11-02 07:23:00'),(9,'NEOGEN','','','','','','','','',1,2,'2020-11-02 07:41:36','2020-11-02 07:41:36');
