DROP TABLE IF EXISTS `brandvideo_tb`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `brandvideo_tb` (
  `bv_id` int NOT NULL AUTO_INCREMENT COMMENT 'Brand video id',
  `bv_brand` int NOT NULL DEFAULT '0' COMMENT 'Brand id',
  `bv_videotitle` varchar(100) NOT NULL DEFAULT '' COMMENT 'Video title',
  `bv_description` text COMMENT 'Description',
  `bv_videoembedurl` varchar(150) NOT NULL DEFAULT '' COMMENT 'Video embed url',
  `bv_videowatchurl` varchar(150) NOT NULL DEFAULT '' COMMENT 'Video watch url',
  `bv_usestate` tinyint NOT NULL DEFAULT '1' COMMENT 'Use state',
  `bv_listorder` int NOT NULL DEFAULT '0' COMMENT 'List order',
  `bv_createddatetime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Created date bvme',
  `bv_updateddatetime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Updated date time',
  PRIMARY KEY (`bv_id`),
  KEY `bv_brand` (`bv_brand`),
  KEY `bv_videotitle` (`bv_videotitle`),
  KEY `bv_usestate` (`bv_usestate`),
  KEY `bv_listorder` (`bv_listorder`),
  KEY `bv_createddatetime` (`bv_createddatetime`),
  KEY `bv_updateddatetime` (`bv_updateddatetime`)
) ENGINE=MyISAM AUTO_INCREMENT=29 DEFAULT CHARSET=utf8 COMMENT='Brand Video';
