tps://www.youtube.com/embed/YoTK7qauKOE','https://www.youtube.com/watch?v=YoTK7qauKOE',1,0,'2020-10-26 11:20:51','2020-10-26 11:20:51'),(9,2,'여름에 쓰기 딱 좋은 쿨링 에어컨 선쿠션이 나타났다?! [와이낫2 WHY NOT?]','여름철 피부 온도를 내리고 싶을 땐,\n와이낫에서 하연수가 소개한 큐어 워터 스플래쉬 쿨링 선쿠션을 사용하면 돼요!\n\n피부 온도를 -3도나 내려주는 기특한 쿨링 선쿠션 만나러 가보실까요?\nhttps://bit.ly/2W0gsoh\nMusic in this video\nLearn more\nListen ad-free with YouTube Premium\nSong\nLife Is Rosy\nArtist\nPosition Music\nAlbum\nUPDATE -Growing In The Cold\nLicensed to YouTube by\nPositionMusic (Sound Recordings) (on behalf of Pos1-0000-0000); Position Music, Inc., CMRRA, AMRA, ASCAP, LatinAutor, Audiam (Publishing), BMI - Broadcast Music Inc., and 17 Music Rights Societies\nSong\nSweeter - Position Music\nArtist\nJess Penner\nAlbum\nLove, Love, Love\nLicensed to YouTube by\nPositionMusic (Sound Recordings); LatinAutor, BMI - Broadcast Music Inc., Position Music, Inc., and 11 Music Rights Societies\nSong\nDont Leave Me (Ne Me Quitte Pas)\nArtist\nRegina Spektor\nWriters\nRegina Spektor\nLicensed to YouTube by\nWMG; CMRRA, Warner Chappell, Sony ATV Publishing, UNIAO BRASILEIRA DE EDITORAS DE MUSICA - UBEM, SOLAR Music Rights Management, LatinAutor - SonyATV, ООО С.Б.А. Мьюзик Паблишинг/S.B.A.Music Publishing LTD, LatinAutorPerf, and 13 Music Rights Societies\nSong\nThings\nArtist\nRobbie Williams, Jane Horrocks\nWriters\nBobby Darin\nLicensed to YouTube by\nUMG (on behalf of Universal-Island Records Ltd.); UNIAO BRASILEIRA DE EDITORAS DE MUSICA - UBEM, LatinAutorPerf, Audiam (Publishing), PEDL, Sony ATV Publishing, LatinAutor - Warner Chappell, CMRRA, BMG Rights Management (US), LLC, ARESA, BMI - Broadcast Music Inc., LatinAutor - PeerMusic, EMI Music Publishing, and 6 Music Rights Societies','https://www.youtube.com/embed/ilGef4KbRHw','https://www.youtube.com/watch?v=ilGef4KbRHw',1,0,'2020-10-26 11:28:27','2020-10-26 11:28:27'),(10,2,'김정문 알로에 cf','Music in this video\nLearn more\nListen ad-free with YouTube Premium\nSong\nOne Mans Dream\nArtist\nYanni\nWriters\nYanni\nLicensed to YouTube by\nSME (on behalf of Masterworks); LatinAutor - SonyATV, LatinAutorPerf, ASCAP, Sony ATV Publishing, CMRRA, UNIAO BRASILEIRA DE EDITORAS DE MUSICA - UBEM, SOLAR Music Rights Management, and 11 Music Rights Societies','https://www.youtube.com/embed/QEyJMqjnzk0','https://www.youtube.com/watch?v=QEyJMqjnzk0',1,0,'2020-10-26 11:34:59','2020-10-26 11:34:59'),(11,2,'큐어크림: 나만의 활용법','한번 쓰면 멈출 수 없는 대한민국 대표 만능크림! \n1990년 런칭해 500만개 넘게 팔린 큐어크림의 활용법은 몇가지나 될까요? \n\n영상에 나와있는 수십가지 활용법외에도 나만의 활용법이 있다면 댓글로 알려주세요!  :) \n\n예시) 현직 소방관입니다. 소방서에서는 화재 진압 후, 얼굴에 달라붙은 그을음을 씻어내기 위해 클렌징을 여러번 합니다. 그래서 예민해진 피부에는 큐어크림만한게 없습니다. 저희 소방서에 꼭 필요한게 하나 있다면 바로 큐어크림입니다.\n\n저희 어린이집에서는 큐어크림을 하루에도 여러번 쓴답니다. 아이들이 벌레 물렸을 때, 간지러워 할때, 추위나 더위로 얼굴에 빨개졌을 때, 심지어 작은 상처에도 큐어크림을 바른답니다. 혹시나 있을지 모르는 화상에 대비해서도 큐어크림을 어린이집 필수템으로 자리잡았어요!','https://www.youtube.com/embed/2tpl1wzFCOQ','https://www.youtube.com/watch?v=2tpl1wzFCOQ',1,0,'2020-10-26 11:36:56','2020-10-26 11:36:56'),(12,2,'ALOE REFRESH JELLY SERUM + ALOE HYDRO JELLY CREAM','“진정한 외강내유 크림“\n\n속은 촉촉한 수분 탄력감,\n겉은 보송한 시카 진정\n\nALOE REFRESH JELLY SERUM \nALOE HYDRO JELLY CREAM\n\n환절기, 건조주의보가 나타났다!\n코어 캡슐 테크놀로지로 알로에 알갱이가 보인다?\n막 착즙한 알로에를 내 피부에?\n\n72% 함유된 알로에로 피부가 필요한 콜라겐, 엘라스틴,\n더하기 히알루론산까지, 리포좀화하여 진피층에 깊숙히!\n속당김 해결 순삭! + 탄력, 미백, 진정까지.','https://www.youtube.com/embed/GoLYhhcfO54','https://www.youtube.com/watch?v=GoLYhhcfO54',1,0,'2020-10-26 11:39:31','2020-10-26 11:39:31'),(13,2,'드디어 시작되는 전설의 주접뉴스!  그냥 마스크팩이 아니라 生알로에 마스크팩  주접 후기를 지금 바로 확인해보세요!','여러분, 안녕하세요 김정문알로에입니다. \n\n저희 제품에 장점을 어떻게 하면 잘 어필해볼 수 있을까 고민한 끝에, 다소 과장된 컨텐츠로 제품의 장점과 재미를 선사할 수 있는 \"\"주접뉴스\"\" 를 기획하게 되었습니다.\n\n김정문알로에 사내 직원들이 힘을 모아서 재미있게 촬영한 영상이오니 즐겁게 시청 부탁드리겠습니다^^\n\n제품 구매 URL은 아래와 같습니다.\n\n\n','https://www.youtube.com/embed/jTe70gQ8j3M','https://www.youtube.com/watch?v=jTe70gQ8j3M',1,0,'2020-10-26 11:42:31','2020-10-26 11:42:31'),(14,2,'좀비마을에서 완판된 김정문알로에 큐어크림!','김정문알로에 X 다다뷰티\n\n좀비마을에 영업뛰러 왔다?!\n크림의 만능활용법에 점점 빠져드는 좀비들,\n영업사원은 실적 생각에 급발진을 하게 되는데..\n\n#큐어크림 #김정문알로에 #만능크림 #보습크림\n