DROP TABLE IF EXISTS `reviewvideoproduct_tb`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `reviewvideoproduct_tb` (
  `rvp_id` int NOT NULL AUTO_INCREMENT COMMENT 'Review video product id',
  `rvp_reviewvideo` int NOT NULL DEFAULT '0' COMMENT 'Review video id',
  `rvp_brand` int NOT NULL DEFAULT '0' COMMENT 'Brand id',
  `rvp_productcategory1` int NOT NULL DEFAULT '0' COMMENT 'Step 1 category id',
  `rvp_productcategory2` int NOT NULL DEFAULT '0' COMMENT 'Step 2 category id',
  `rvp_productname` varchar(200) NOT NULL DEFAULT '' COMMENT 'Product name',
  `rvp_priceinfo` varchar(50) NOT NULL DEFAULT '' COMMENT 'Price info',
  `rvp_description` text COMMENT 'Description',
  `rvp_productimageurl` varchar(400) NOT NULL DEFAULT '' COMMENT 'Product image url',
  `rvp_productdetailurl` varchar(250) NOT NULL DEFAULT '' COMMENT 'Product detail url',
  `rvp_usestate` tinyint NOT NULL DEFAULT '1' COMMENT 'Use state',
  `rvp_listorder` int NOT NULL DEFAULT '0' COMMENT 'List order',
  `rvp_createddatetime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Created date sbvme',
  `rvp_updateddatetime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Updated date time',
  PRIMARY KEY (`rvp_id`),
  KEY `rvp_reviewvideo` (`rvp_reviewvideo`),
