mented treatment is also formulated with 17% birch juice to add hydration and 9% rice extracts to illuminate skin from within. Full of natural brighteners, antioxidants and cell-communicating ingredients, this essence is the key to glowing, supple \"\"honey skin\"\". To maximize results and benefits use with Micro Serum. \n\nThis product has a pH level of ~5. \n\n150 ml /5.07 fl oz \n\n','https://cdn.shopify.com/s/files/1/0249/1218/products/NeogenRealFermentMicroEssenceRepackagePDP_860x.jpg','https://sokoglam.com/products/neogen-real-ferment-micro-essence',1,0,'2020-11-02 07:45:04','2020-11-02 07:45:04'),(8,23,2,1,5,'Kim Jeong Moon Aloe Cure Plus Intensive 2X Cream 50g','$37.50 -> $23.95','Kim Jeong Moon Aloe Cure Plus Intensive 2X Cream Features:\nKim Jeong Moon Aloe Cure Plus Intensive 2X Cream provides a calming and moist feeling to the skin\nA combination of Aloe Vera and beeswax provides a healthy alternative to Vaseline.\nA natural solution for chapped and dry skin.\nUsed to heal and calm bug bites and skin allergies.\n\n\nKim Jeong Moon Aloe Cure Plus Intensive 2X Cream Specifications:\n- For All Skin Type\n- Capacity : 50g (1.76oz)\n- Manufacturer: South Korea (KIM JEONG MOON ALOE CO. LTD.)\n- Expiration Date: 12 months after opening\n- Quantity: 1EA\n \n\nKim Jeong Moon Aloe Cure Plus Intensive 2X Cream Ingredients:\nPetrolatum Beeswax, Cetyl Ethylhexanoate, Hydrogenated Polyisobutene, Glycine Soja (Soybean) Oil Sorbitan Sesquioleate, Lavandula Angustifolia (Lavender) Oil, Hydrogenated Cottonseed Oil, Tocopheryl Acetate, Aloe Arborescens, Leaf Extract Aloe, Barbadensis Leaf Juice, Propolis Extract, Centella Asiatica Extract, Butylene Glycol, Armeniaca (Apricot) Kernel Oil, Camellia Sinensis Seed Oil, Butyrospermum Parkii (Shea) Butter, Argania Spinosa Kernel Oil, Persea Gratissima (Avocado) Oil, Melaleuca Alternifolia (Tea Tree) Leaf Oil, Helianthus Annuus (Sunflower) Seed Oil, Ceramide.','https://cdn.shopify.com/s/files/1/0249/4985/0165/products/cream-1_24