s after opening\n- Quantity: 1EA\n\n \n\nHow to use Kim Jeong Moon Aloe Cure Hydra Soothing Toner:\n- Step 1) Kim Jeong Moon Aloe Cure Hydra Soothing Toner:\nAfter washing the face, use cotton pads to gently apply from the center to the sides according to the skin texture.\n\n\n- Step 2) Kim Jeong Moon Aloe Cure Hydra Soothing Emulsion:\nAfter applying the skin toner, evenly apply an appropriate amount on the face, starting from the inside and working outward; gently tap to promote absorption into the skin.\n\n\nKim Jeong Moon Aloe Cure Hydra Soothing Toner Ingredients:\n \n\nAloe Barbadensis Leaf Juice, Glycerin, Butylene Glycol, Dipropylene Glycol, 1.2 Hexanediol, Niacinamide, Water, PEG-40 Hydrogenated Castor Oil, PPG-26-Buteth-26, Centella Asiatica Extract, Tromethamine, Scutellaria Baicalensis Root Extract, Citrus Aurantium Dulcis (Orange) Peel Oil, Adenosine, Glycyrrhiza Glabra (Licorice) Root Extract, Camellia Sinensis Leaf Extract, Disodium EDTA, Rosmarinus Officinalis (Rosemary) Leaf Extract, Chamomilla Recutita (Matricaria) Flower Extract, Lavandula Angustifolia (Lavender) Oil, Rosmarinus Officinalis (Rosemary) Leaf Oil, Mentha Piperita (Peppermint) Oil, Anthemis Nobilis Flower Oil, Salix Alba (Willow) Bark Extract, Lactobacillus/Soybean Ferment Extract, Portulaca Oleracea Extract, Origanum Vulgare Leaf Extract, Cinnamomum Cassia Bark Extract, Chamaecyparis Obtusa Leaf Extract, Caprylyl Glycol, Acrylates/C10-30, Alkyl Acrylate Crosspolymer, Polygonum, Cuspidatum Root Extract.','https://cdn.shopify.com/s/files/1/0249/4985/0165/products/tonner-1_2400x.jpg','https://kjmskincare.com/products/kim-jeong-moon-aloe-cure-hydra-soothing-toner-130ml',1,0,'2020-11-02 12:24:46','2020-11-02 12:24:46'),(13,28,2,1,5,'Kim Jeong Moon Aloe Cure Plus Intensive 2X Cream 50g','$37.50 -> $23.95','Kim Jeong Moon Aloe Cure Plus Intensive 2X Cream Features:\nKim Jeong Moon Aloe Cure Plus Intensive 2X Cream provides a calming and moist feeling to the skin\nA combination of Aloe Vera