y wreck havoc on our skin.\n\nThis cream is formulated with 7% Bio RTx, a specially designed complex, to strengthen skin barrier and protect skin from further damage. Antibacterial peptides ward off harmful bacteria while salicylic acid and basil petal extract balance skin’s moisture level and reduce excess sebum production.\n\nIf you want more even toned skin and to repair any damage, use this cream in your daily routine.\n\n0.70 oz / 20 ml','https://cdn.shopify.com/s/files/1/0061/2564/9987/products/Dr.-G-Bio-RX-Mentor-Cream-7-Damaged-Skin_540x.jpg','https://real-beauty-outlet.myshopify.com/collections/skin-care/products/dr-g-bio-rtx-mentor-cream-7-damaged-skin',1,0,'2020-11-02 15:36:03','2020-11-02 15:36:03'),(21,36,4,1,0,'Dr.G - Brightening Peeling Gel','CA$31.80 -> CA$22.29','Skin Type: Combination, Dry, Normal, Oily, Sensitive\nSkin Concern: Blackheads, Dullness / Radiance, Oil Control/ Pores','https://cdn.stylevana.com/media/catalog/product/cache/5/image/9df78eab33525d08d6e5fb8d27136e95/d/r/dr-g-brightening-peeling-gel-120g-663.jpg','https://www.stylevana.com/en_CA/dr-g-brightening-peeling-gel-1.html',1,0,'2020-11-02 15:42:21','2020-11-02 15:42:21'),(22,37,4,1,4,'Dr.G - R.E.D Blemish Clear Soothing Toner - 300ml','CA$41.19','Usage: Day, Night\nProduct Type: Toner & Mist\nSkin Concern: Dryness/ Hydration\nSkin Type: Combination, Dry, Normal, Oily','https://cdn.stylevana.com/media/catalog/product/cache/5/image/9df78eab33525d08d6e5fb8d27136e95/d/r/dr-g-r-e-d-blemish-clear-soothing-toner-300ml-368.jpg','https://www.stylevana.com/en_CA/dr-g-r-e-d-blemish-clear-soothing-toner-300ml.html',1,0,'2020-11-02 15:48:33','2020-11-02 15:48:33'),(23,38,4,1,0,'Dr.G Brightening Peeling Gel, 4.2 Ounce','$11.60','Gentle exfoliator with vitamin brightening effect\nContains natural moisture-rich cellulose\nArranges the skin moisturized and radiant','https://images-na.ssl-images-amazon.com/images/I/31rgOkQ9Z5L.jpg','https://www.amazon.com/gp/product/B007TFW0B6',1,0,'2020-11-02 15:54:26','2020-11-02 15:54:26'),(24,39,4,1,0,'Dr.G Brightening Peeling Gel 120g','CA$28.00','SKU:\n1617\nCategories: Cleansers, Exfoliators, Skin Care\nTags:\nbrandsale20\n,\nBrightening\n,\nDR.G\nBrand:\nDR.G','https://pinknblossom.com/wp-content/uploads/2020/07/Dr.G-Brightening-Peeling-Gel-120g-Renew.jpg','https://pinknblossom.com/product/dr-g-brightening-peeling-gel/',1,0,'2020-11-02 16:01:25','2020-11-02 16:01:25'),(25,40,4,1,3,'Dr G Hyper Brightening Serum 30 ml / 1 fl oz','$47.00','Dr. G Hyper Brightening Capsule Serum is a part of Dr.G Hyper Brightening line. This line does not only eliminate simple pigmentation. It is a multi-whitening products line that makes the skin even, granting a healthy skin barrier that is moist and clear.\n\nFEATURES & BENEFITS:\n\nThe concentrated vitamin complex that has been applied to the stabilized transparent formula enhances rapid absorption to the skin. This brightening capsule serum leaves the skin moist and glowing as its moisture oil capsules break open upon application.\nOrganic whitening ingredient ‘Alpha-bisabolol,’ vitamin complex ‘Vit B (Inositol)+Vit C (Illumiscin) +Vit E’, and freckle-enhancing ‘tranexamic acid’ effectively care for visible dappled freckles, pigmentation as well as the hidden roots of melanin.\nIt cares for red and yellow skin tones, which are the cause of darkened skin, and brightens several dark spots to make the skin bright and clear.\n‘Dr.G Barrier Complex’ protects the barrier and maintains the skin’s health, preventing it to be easily darkened.','https://www.eskinstore.com/productcart/pc/catalog/Hyper_Brightening_Serum___NEW_2_detail.jpg','https://www.eskinstore.com/Hyper-Brightening-Serum-P47725',1,0,'2020-11-02 16:07:39','2020-11-02 16:07:39'),(26,41,4,1,5,'Dr.G - R.E.D Blemish Clear Soothing Cream - 70ML - 70ml','$41.12 -> $23.49','Usage: Day, Night\nProduct Type: Moisturizer & Cream\nProduct Unit: 70ml\nSkin Concern: Irritation/ Calming\nSkin Type: Combination, Dry, Normal, Oily','https://cdn.stylevana.com/media/catalog/product/cache/1/image/9df78eab33525d08d6e5fb8d27136e95/d/r/dr-g-r-e-d-blemish-clear-soothing-cream-70ml-70ml-white-61.jpg','https://www.stylevana.com/en_US/dr-g-r-e-d-blemish-clear-soothing-cream-70ml-70ml.html',1,0,'2020-11-02 16:14:31','2020-11-02 16:14:31'),(27,42,1,1,0,'LOOKS & MEII Fresh-Routine Energy Ampoule 30ml','KWR 39,000 -> 31,200','피부에 충분한 영양 성분을 공급하여 탄탄하고 활력 넘치는 건강한 피부로 가꿔주는 에너지 앰플','https://cdn.imweb.me/thumbnail/20200717/0c6adcce72935.png','https://www.looksnmeii.com/ampoule/?idx=198',1,0,'2020-11-02 16:25:21','2020-11-02 16:25:21'),(28,43,1,1,0,'LOOKS & MEII Aura Water Glow Cushion','KWR 45,000 -> 36,000','수분이 차오르는 듯한 광채와 가볍고 우수한 밀착력으로 본연의 내 피부처럼 자연스러운 윤광을 선사하는 리얼 글로우 쿠션','https://cdn.imweb.me/thumbnail/20200717/05fd0fad37eae.png','https://www.looksnmeii.com/cusion/?idx=205',1,0,'2020-11-02 16:32:05','2020-11-02 16:32:05'),(29,44,1,1,2,'LOOKS & MEII REAL ALOE FIT Intensive Soothing Mask','KWR 40,000 -> 32,000','먹고 붙이는 IN & FIT 더블 프로바이오틱스 케어!\n\n외부 활동으로 자극 받은 피부에 더블 프로바이오틱스 케어로 피부를 편안하게 진정시키고 활력 있는 피부를 선사하는 리얼 알로에 핏 인텐시브 수딩 마스크 & 프로바이오틱스 인 부스터 스틱 (각 10개입)','https://cdn.imweb.me/thumbnail/20200717/4ba4190d0b347.png','https://www.looksnmeii.com/calming/?idx=230',1,0,'2020-11-02 16:39:33','2020-11-02 16:39:33'),(30,45,1,1,2,'LOOKS & MEII REAL Centella Relaxation Perfect Calming Mask','KWR 30,000 -> 24,000','Centellica™이 함유되어 자극 받은 피부를 편안하게 진정시켜주며, 촉촉하고 건강한 피부로 가꾸는데 도움을 주는 퍼펙트 카밍 마스크 (10개입)','https://cdn.imweb.me/thumbnail/20200811/b030647924f99.png','https://www.looksnmeii.com/sheetmask/?idx=191',1,0,'2020-11-02 16:44:48','2020-11-02 16:44:48'),(31,46,1,1,2,'LOOKS & MEII Brightening Lift Up Perfect Fit Mask with MAMACOMMA','KWR 30,000 -> 24,000','피부를 환하게 밝혀주고 Vita 3 Complex가 피부에 투명한 광채 수분을 선사하는 브라이트닝 마스크 (10개입)','https://cdn.imweb.me/thumbnail/20200717/b7008897619ef.png','https://www.looksnmeii.com/sheetmask/?idx=190',1,0,'2020-11-02 16:52:10','2020-11-02 16:52:10'),(32,47,1,1,3,'LOOKS & MEII Hydrangea Cica Serum','KWR 32,000 -> 22,400','건조하고 푸석해진 피부에 집중 수분을 공급하여 예민해진 피부를 촉촉하고 건강하게 케어하는 수국 시카 세럼 #수카세럼 ','https://cdn.imweb.me/thumbnail/20200914/a224230c93a90.png','https://www.looksnmeii.com/ampoule/?idx=268',1,0,'2020-11-02 16:59:10','2020-11-02 16:59:10');
