DROP TABLE IF EXISTS `subscriptionbox_tb`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `subscriptionbox_tb` (
  `sb_id` int NOT NULL AUTO_INCREMENT COMMENT 'Subscription box id',
  `sb_productname` varchar(50) NOT NULL DEFAULT '' COMMENT 'Product name',
  `sb_priceinfo` varchar(50) NOT NULL DEFAULT '' COMMENT 'Price info',
  `sb_pricepermonth` decimal(7,2) NOT NULL DEFAULT '0.00' COMMENT 'Price per month',
  `sb_description` text COMMENT 'Description',
  `sb_productimageurl` varchar(400) NOT NULL DEFAULT '' COMMENT 'Product image url',
  `sb_subscriptionurl` varchar(250) NOT NULL DEFAULT '' COMMENT 'Subscription url',
  `sb_usestate` tinyint NOT NULL DEFAULT '1' COMMENT 'Use state',
  `sb_affiliateapprovalstate` tinyint NOT NULL DEFAULT '1' COMMENT 'Affiliate approval state',
  `sb_affiliatecode` varchar(20) NOT NULL DEFAULT '' COMMENT 'Affiliate code',
  `sb_affiliatecommissionrate` decimal(5,2) NOT NULL DEFAULT '0.00' COMMENT 'Affiliate commission rate',
  `sb_listorder` int NOT NULL DEFAULT '0' COMMENT 'List order',
  `sb_createddatetime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Created date time',
  `sb_updateddatetime` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Updated date time',
  PRIMARY KEY (`sb_id`),
  KEY `sb_productname` (`sb_productname`),
  KEY `sb_pricepermonth` (`sb_pricepermonth`),
  KEY `sb_usestate` (`sb_usestate`),
  KEY `sb_affiliatecode` (`sb_affiliatecode`),
  KEY `sb_affiliatecommissionrate` (`sb_affiliatecommissionrate`),
  KEY `sb_createddatetime` (`sb_createddatetime`),
  KEY `sb_updateddatetime` (`sb_updateddatetime`),
  KEY `sb_listorder` (`sb_listorder`),
  KEY `sb_affiliateapprovalstate` (`sb_affiliateapprovalstate`)
) ENGINE=MyISAM AUTO_INCREMENT=31 DEFAULT CHARSET=utf8 COMMENT='Subscription Box';
/*!40101 SET character_set_client = @saved_cs_client */;

