INSERT INTO `subscriptionbox_tb` VALUES (1,'nomakenolife beauty box','$31.50 USD (12 Months)',31.50,'SELECT YOUR PLAN\r\n\r\nYour beauty box ships worldwide from Tokyo, straight to your door every month!\r\n','https://images.prismic.io/nomakenolife/4844047f-591e-4c11-be25-d1622541bb19_2.png?auto=compress,format','https://nomakenolife.com/subscribe',1,1,'',0.00,13,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(2,'Kiyomi Beauty Pouch','$9.99 (Monthly)',9.99,'Kiyomi Beauty Pouch\r\n\r\nDiscover new K-Beauty sheet masks every month. \r\n\r\nIn the pouch, you will receive a curated selection of 4 sheet masks and an information card.\r\n\r\n$9.99\r\n\r\nElevate your skincare routine and discover endless Korean skincare and beauty product possibilities with our two subscription options!\r\n','https://s3.amazonaws.com/cratejoy_vendor_images/f8506fa26acf445cb65583415e9123de.jpeg','https://kiyomi-beauty-box.cratejoy.com/subscribe/',1,1,'',0.00,11,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(3,'Kiyomi Beauty Box','$39.99 (Seasonal)',13.33,'Kiyomi Beauty Box\r\n\r\nDiscover endless K-Beauty products delivered right to your doorstep. \r\n\r\nIn the box, you will receive 6-7 full-size curated beauty products and an information card.\r\n\r\n$39.99 - $155.00\r\n\r\nElevate your skincare routine and discover endless Korean skincare and beauty product possibilities with our two subscription options!\r\n','https://s3.amazonaws.com/cratejoy_vendor_images/ca656ba5734e4b7791df3f1847760acf.jpeg','https://kiyomi-beauty-box.cratejoy.com/subscribe/',1,1,'',0.00,6,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(4,'BomiBox Luxe','$39.00 (Monthly)',39.00,'BomiBox Luxe\r\n\r\nKorean Beauty Subscriptions\r\n\r\nSubscribe to begin your Korean Beauty journey and get a curated box or bag of Korean Skincare products.\r\nYour subscription auto-renews at the end of the month.\r\n\r\nBOMIBOX (MONTHLY)\r\n\r\nBomiBox Luxe - Choose a monthly subscription or a gift option and receive a box every month. \r\nYoull receive a BomiBox which includes a selection of Full Sized or Deluxe Sample Sized Korean Beauty items. \r\nProducts include a variety of skincare, makeup or beauty tools. \r\nShips at the end of the month every month. \r\nExample image shown.\r\n','//s3.amazonaws.com/cratejoy_vendor_images/fd0dc9be32264075ab1415a19a46b4f7.jpeg','https://bomibox.cratejoy.com/subscribe/?sca_ref=425554.h1e2nHu0ip',1,2,'',0.00,4,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(5,'JoahBox','$35.95 (Per Month)',35.95,'Choose Your Subscription Plan\r\n\r\nHow It Works\r\n\r\n1. Join JoahSquad\r\nEach Month, we send you 5 to 7 Full-sized Korean cosmetics from best K-Beauty Brands, which has a value of up to $100. \r\nWe also include tips and tricks on how to use them!\r\n\r\n2. Start Unboxing\r\nTry on your new k-beauty product delivered to your doorstep.\r\n\r\n3. Enjoy & Share\r\nEnjoy the products and share your reviews and own tips on Social Media!','https://joahbox.com/wp-content/uploads/LandingPage-1.jpg','https://joahbox.com/subscription_plans/',1,1,'',0.00,27,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(6,'Allure Beauty Box','$15 (Per Month)',15.00,'The Best in Beauty — Delivered Monthly\r\n\r\nJOIN NOW FOR ONLY $15 A MONTH\r\n\r\nWhat You Get\r\n\r\nLet us deliver a small bit of comfort, creativity, and connection — from the Allure  team to you. \r\nGet 5+ monthly makeup and skincare picks from our editors, delivered to your doorstep ($70+ value for only $15).  \r\n\r\nTop products selected by Allure editorial experts (we test more than 50,000 products a year)\r\n\r\nAlways free shipping\r\n\r\nAt least 2 Full-Size products in every box \r\n\r\nNew member gift: A bonus gift valued at $15+\r\n\r\nA mini-mag with tips and exclusive offers','https://images.squarespace-cdn.com/content/v1/587fedb686e6c00a383fbfca/1568130140239-164CGS0GKH21RJK3I2AT/ke17ZwdGBToddI8pDm48kFWxnDtCdRm2WA9rXcwtIYR7gQa3H78H3Y0txjaiv_0fDoOvxcdMmMKkDsyUqMSsMWxHk725yiiHCCLfrh8O1z5QPOohDIaIeljMHgDF5CVlOqpeNLcJ80NK65_fV7S1UcTSrQkGwCGRqSxozz07hWZrYGYYH8sg4qn8Lpf9k1pYMHPsat2_S1jaQY3SwdyaXg/about.jpg?format=750w','https://beautybox.allure.com/',1,1,'',0.00,25,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(7,'THE K-BEAUTY BOX','$34.95 / month',34.95,'Monthly Subscription Box\r\n\r\nRegular price$34.95 Sale price/ month\r\n\r\nUse code MYFIRSTBOX2 and get $2 discount!\r\n\r\nFree worldwide shipping on all subscription boxes! You save $10 every month!\r\n\r\nThe K-beauty Monthly Subscription Box is a fun and simple way to try and discover new K-beauty favorites for your daily skin care routine while saving money with low discounted price + free worldwide shipping.\r\n\r\nHow monthly subscription works:\r\nYou will receive a new K-beauty box once a month until you cancel (you can cancel online at any time).\r\nYour first box will be shipped in 1-2 working days and arrive in 5-10 working days.\r\nYour following boxes will then be shipped around the same day each month.\r\n\r\nWhy buy a K-beauty monthly subscription:\r\nTry and discover new K-beauty products from top Korean beauty and skin care brands.\r\nSave with discounted prices on every product.\r\nSave with free shipping instead of ordering from multiple shops.','https://cdn.shopify.com/s/files/1/0246/3930/7860/products/monthly-new-example-etude2_6716c004-2c7c-48ec-bb0b-34bf60bb6974_1080x.jpg?v=1595658158','https://thekbeautybox.com/products/monthly-subscription-box?ref=1571',1,2,'',0.00,2,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(8,'FaceTory 7 LUX SUBSCRIPTION','$19.90 / month',19.90,'FaceTory Subscriptions\r\nFree US Shipping. International shipping rates vary.\r\n\r\nMonthly subscription plan\r\nBilling occurs every month after your first purchase date\r\nCancel any time (before next billing date)\r\nThe ingredients list for each product featured in 7 Lux is searchable through our website.\r\nItems featured on product image may or may not be included in your subscription\r\nQuestions? Check out our FAQ or contact us at support@facetory.com.\r\n\r\n7 Luxurious Sheet Masks\r\n+ 1-2 Bonus Items\r\n\r\n$19.90 / month\r\n\r\nBilled Monthly\r\nFree US shipping\r\nAuto-renews, cancel at any time\r\nTo receive current months plan, \r\nsubscribe by the last day of the same month, EST\r\n\r\n','https://cdn.shopify.com/s/files/1/1441/1354/files/20_09_Facetory_September_LUX_Box_Photo_1200x1200_54173362-37b9-4508-9034-1fac4d8ab7cc.jpg?v=1598931296','https://www.facetory.com/products/seven-lux',1,1,'',0.00,23,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(9,'FaceTory LUX PLUS SUBSCRIPTION','$49.95 / season',16.65,'Its about that time again for scarves, sweaters, pumpkin spice lattes, and... the arrival of dry skin?! (cue dramatic music) Luckily, you have nothing to worry about because we curated our favorites to keep your skin hydrated, soft, and glowing despite the cooler temperatures and windier weather! We hope our Fall 2020 Lux PLUS box brings your skin and body care routines a little extra dose of love this season!\r\n\r\n- Seasonal subscription plan (every three months)\r\n- Billing occurs every three months after your first purchase date\r\n- Cancel any time (before next billing date)\r\n\r\nFaceTory Subscriptions\r\nFree US Shipping. International shipping rates vary.\r\n\r\n5-6 Skincare Products\r\n+ 5-6 Sheet Masks\r\n\r\n$49.95 / season\r\n\r\nBilled Seasonally\r\nFree US shipping\r\nAuto-renews, cancel at any time\r\nTo receive the Spring box, \r\nsubscribe by May 31, 2020 11:59 EST\r\n\r\n','https://cdn.shopify.com/s/files/1/1441/1354/files/20_09_facetory_fall_lux_plus_box_photo_1200x1200_3f9265e6-a877-451e-a1db-cea982215b31.jpg?v=1598931296','https://www.facetory.com/products/lux-plus',1,1,'',0.00,21,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(10,'Beauteque Monthly','$24 / month',24.00,'BEAUTY BOX\r\n\r\nCalling all K-Beauty enthusiasts: six full-sized products delivered to your door monthly!\r\nReceive an assortment of skincare, makeup, body and hair care, and much more.\r\n\r\nS