nd filtrates help to improve your overall skin health, plus help to reduce the look of wrinkles. \r\n(3 masks total per box)','https://maskboxbeauty.com/wp-content/uploads/2017/05/anti-aging.jpg','https://maskboxbeauty.com/shop-subscriptions/anti-aging-2/',2,1,'',0.00,20,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(16,'Hydration Box (Mask Box)','$9.99 (Month)',9.99,'Hydration Box\r\n\r\nproduct description\r\n\r\nThe Hydration Box features sheet masks focused on hydrating your skin. \r\n\r\nWhether you’re trying to survive harsh winter weather, getting over a night of drinking, or wanting to pamper yourself with what feels like a glass of H2O to your face,\r\n \r\nthese masks help dry skin to become hydrated and soft. \r\n\r\nHydrating masks typically include a main ingredient that contains a molecule that causes your skin to retain more moisture. \r\n(3 masks total per box)','https://maskboxbeauty.com/wp-content/uploads/2017/05/hydration.jpg','https://maskboxbeauty.com/shop-subscriptions/hydration-2/',2,1,'',0.00,19,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(17,'Brightening Box (Mask Box)','$9.99 (Month)',9.99,'Brightening Box\r\n\r\nproduct description\r\n\r\nThe Brightening Box is comprised of sheet masks that are focused on brightening and/or whitening your skin. \r\nDon’t let stress or lack of sleep diminish your healthy glow! \r\nVitamin C is a common ingredient, which can aid in brightening, plus has exfoliating properties. \r\n\r\nStudies also show niacinamide diminishes hyperpigmentation and evens out skin tone. \r\nPearl powder/extracts also provide radiance. \r\n(3 masks total per box)','https://maskboxbeauty.com/wp-content/uploads/2017/05/brightening.jpg','https://maskboxbeauty.com/shop-subscriptions/brightening-2/',2,1,'',0.00,29,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(18,'Combo Box (Mask Box)','$9.99 (Month)',9.99,'Combo Box\r\n\r\nproduct description\r\n\r\nThe Combination Box offers a selection of sheet masks that target a variety of skinca