 time each month. \r\nFor example, if you join December 18th, your next payment will be processed January 18th. \r\nPlease note that if the date of your payment lands on a non-business or holiday, the processing time may take longer. \r\nYou will receive an email when your payment has been processed.\r\n\r\nFree U.S. Shipping\r\n\r\nEach Sooni Mask Pouch is shipped with no additional charge for U.S. customers on the first full week of the following month. \r\nYou will receive an email with your tracking number when your Sooni Mask Pouch is shipped. \r\nWe currently do not provide international shipping; \r\nwe hope to add international shipping in the future.','https://mlw3zn5ebxke.i.optimole.com/phgBM5o-kq5d87Bd/w:auto/h:auto/q:auto/https://soonipouch.com/wp-content/uploads/2019/01/June2018Sooni.jpg','https://soonipouch.com/product/sooni-pouch/',1,1,'',0.00,16,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(26,'Daebak Box - Seasonal Plan','$54.99 (Season)',18.33,'Daebak Box - Seasonal Plan\r\n\r\n','http://www.subserve.life/files/subscription/DaebakBox.jpg','https://daebak.co/collections/subscribe/products/seasonal',1,1,'',0.00,22,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(27,'BIRCHBOX','$15 per month',15.00,'BIRCHBOX\r\n\r\nLet’s make finding beauty stuff fun. \r\n\r\nBirchbox is a simple and delightful way to update your beauty routine. \r\n\r\nWhen you subscribe to Birchbox, you’ll receive a monthly package with a mix of 5 deluxe samples from a variety of categories - all handpicked by our team, matched to your unique needs, and paired with helpful tips on how to use them.\r\n\r\nMONTHLY PLAN\r\n\r\n$15/month\r\n\r\nCancel at any time\r\n','https://edge.birchbox.com/CMSV2/en_US/images/847445206b0540078821088ee3d5cfd1.jpeg?dpr=1&enable=upscale&width=250','https://www.birchbox.com/subscribe/women',1,1,'',0.00,7,'2020-10-01 14:15:35','2020-10-01 14:15:35'),(28,'BeautyFIX - September 2020 (1 kit)','$24.95 per month',24.95,'BeautyFIX\r\nSeptember 2020 (1 kit)\r\n\r\