c Ingredients\n100% Cruelty Free\n$50+ Value in Every Box\nEasy To Manage Subscription Renewals','https://vegancuts.com/wp-content/uploads/2019/07/BB_OwnPage_VEGAN-CUTS-4794_lightroom_export_01.jpg','https://vegancuts.com/beautybox/ref/324/',1,2,'',0.00,1,'2020-10-08 11:12:57','2020-10-08 11:12:57'),(30,'The Vegan Makeup Box','$39.95 / season',13.32,'The Vegan Makeup Box\n\nTop Vegan Makeup Brands\n\nNothing but the best cruelty free makeup in our seasonally themed quarterly Vegancuts Makeup Box. \nYou’ll receive at least four full-size vegan cosmetics with color customization available for featured products.\n\nOur professional Makeup Box curator is in the know with every new vegan makeup brand. \nThrough her expert connections she works to include trendy colors, hot new items, and unique new-to-market products. \nThe Makeup Box will have you looking and feeling great without harming animals. \n\n\nOur Promise\n\n100% Vegan\n4+ Deluxe and Full-Size Items Each Month\nFree U.S. Shipping\nNon-Toxic Ingredients\n100% Cruelty Free\nColor Customization for Featured Products\nEasy To Manage Subscription Renewals','https://vegancuts.com/wp-content/uploads/2019/07/V3_NEW_1850x500px_MB_banner_VEGAN-CUTS-4378.jpg','https://vegancuts.com/makeupbox/ref/324/',1,2,'',0.00,3,'2020-10-08 11:12:59','2020-10-08 11:12:59');
