\r\nIm always intrigued by everything beauty and cosmetics. Videos about makeup, nail, skincare, haul and etc will be uploaded every weeks.\r\nIm also an artist(mostly drawing and painting) and crazy cat lady!\r\nFind me on Instagram and say hello! @hello.subin\r\nVisit my drawing and design archive as well. http://subin-is-drawing.tumblr.com\r\n\r\n안녕 이쁜씨들, 수빈이에요.\r\n네일, 메이크업, 지름 비디오 등을 업로드 합니다. 화장품이나 뷰티에 대한건 모두 다 좋아해요.\r\n그림그리는 고양이 집사이기도 해요. 매주 새로운 비디오 올릴게요. \r\n자세한 제품 리뷰나 스킨케어 팁, 그날그날의 메이크업, 네일 등등 깨알같은 이야기는 블로그와 인스타그램에도 아주아주 많답니다.\r\n\r\n블로그 \r\nhttp://blog.naver.com/abbeyroad_\r\n인스타그램 \r\n@hello.pretty \r\nhttps://www.instagram.com/hello.subin/\r\n그림 작업 페이지  \r\nhttp://subin-is-drawing.tumblr.com\r\n','subin.is.drawing@gmail.com','https://www.instagram.com/hello.subin/','https://yt3.ggpht.com/a/AATXAJwYgnRxNH56NDrs-PhCF3HW7kN-5y0aDSzsmb3e=s88-c-k-c0x00ffffff-no-rj',15,79.00,27000,211,2916243,12,4.90,14.00,16.00,11.00,18.00,20.00,'',1,'2020-10-01 01:56:29','2020-10-01 01:56:29'),(9,'하나HANA','https://www.youtube.com/channel/UCrK-BInkhcGogiBoG682DEA','Details\r\nLocation:        South Korea\r\n\r\n','00khn0524@naver.com','https://www.instagram.com/ha.na__0','https://yt3.ggpht.com/a/AATXAJzz9fv-MQIQCB4Jy0G7qTvul-ZS7J1kZieNBS4nVw=s100-c-k-c0xffffffff-no-rj-mo',9,81.00,13500,36,786776,8,5.00,14.00,20.00,11.00,16.00,20.00,'',1,'2020-10-01 01:56:29','2020-10-01 01:56:29'),(10,'피부과전문의주닥티비','https://www.youtube.com/channel/UCC692CU5Gs3XQDu5Jn7hDBQ/featured','Details\r\n\r\nFor business inquiries: jhworld0113@gmail.com\r\n','jhworld0113@gmail.com','https://www.instagram.com/joodoc_/','https://yt3.ggpht.com/a/AATXAJwkA1HdYUjH77dZUzuuNZVAZqfxyneNZZFYDThNyqY=s88-c-k-c0x00ffffff-no-rj',7,83.00,14100,43,974777,24,4.80,14.00,20.00,11.00,20.00,18.00,'',1,'2020-10-01 01:56:29','2020-10-01 01:56:29'),(11,'ThruHelensLens','https://www.youtube.com/c/ThruHelensLens/','Description\r\nIm Helen, a recent university graduate making videos about k-beauty, fashion, and post-grad life. Hope