 passionate about k-beauty! \r\nMy motto is skincare going more than skin deep because I believe in the value skincare has brought to my life. \r\nFrom building more confidence through great skin to learning valuable life lessons while building a skincare routine; \r\nI believe that we can learn so much from our skincare journey.  \r\n\r\nSkin Type: Combo/dry, dehydrated, sensitive\r\n\r\nCome say hi and share the addiction with me!\r\n\r\n|| Content Schedule ||\r\n\r\nCheck my blog out for new posts every Monday\r\nNew videos on YouTube every Tuesday and Thursday\r\n','kellydriscoll@gushcloud.com','https://www.instagram.com/kelldris/','https://yt3.ggpht.com/a/AATXAJylf_P-Yke7deOK3EnzH_PLAZ13L5vimgVSR1ErSA=s88-c-k-c0x00ffffff-no-rj',12,81.00,31200,335,3259186,43,4.90,14.00,16.00,11.00,20.00,20.00,'',1,'2020-10-01 01:56:29','2020-10-01 01:56:29'),(16,'Arna Alayne','https://www.youtube.com/c/ArnaAlayneMorton/','Description\r\nHi, I’m Arna - a classical violinist & music educator at Morton Music, and my channel is all about sharing my life as a creative entrepreneur.\r\n\r\nwww.arnaalaynemorton.com\r\nwww.mortonmusic.online\r\n\r\nIm also a passionate Plant Mom, I love all things Hygge, and - as an INFJ - I just love nothing more than to \"\"go deep\"\" about lifes mysteries haha!\r\n\r\nI started this channel many moons ago as a beauty channel, and have LOVED my time creating content around makeup, skincare, and the like!\r\n\r\nHowever, as Ive drawn closer to turning 30, Im feeling more and more drawn to shifting my content towards lifestyle content that is more in line with the woman I have grown to become.\r\n\r\nOf course, I still LOVE all my beauty bits, so youll still see all my favourite products popping up in my videos and vlogs, but I will no longer be creating 100% beauty-focused content.\r\n','','https://www.instagram.com/arnaalayne/','https://yt3.ggpht.com/a/AATXAJycqzw2lD2fbZRy9h4K0SHWZTYS0lZwsmeNKZIhqg=s88-c-k-c0x00ffffff-no-rj',20,77.00,93500,558,8603303,15,5.00,12.00,16.00,11.00,18.00,20.00,'',1,'2020-10-01 01:56:29','2020-10-01 01:56:29'),(17,'Marie\'s Kawaii World','https://www.youtube.com/c/KawaiiFelting/','Description\r\nHello and welcome to Maries Kawaii World!  My name is Marie and I create videos on YouTube about a fresh, kawaii lifestyle.  I create videos giving you travel tips and guides, cafe and restaurant recommendations, as well as DIYs and inspiration so that you can make kawaii a part of your lifestyle at home.  \r\n\r\nMore about me: https://youtu.be/LHk_jimQlkk\r\nEmail: kawaiifelting@gmail.com\r\n\r\nAddress:\r\nMaries Kawaii World \r\n5625 Hollywood Blvd, \r\nLos Angeles, CA 90028, USA\r\n\r\nMy Patreon Page:\r\nhttps://www.patreon.com/MariesKawaiiWorld\r\n\r\nRSS FEED: https://www.youtube.com/feeds/videos.xml?channel_id=UCIdpL1T2xqYjEHq4-m9lytQ\r\n\r\nLocation:	South Korea','kawaiifelting@gmail.com','https://www.instagram.com/maries_kawaii_world/','https://yt3.ggpht.com/a/AATXAJxudwy923qieEAY6DmjsjXWbKPpG45UG43864wXNg=s88-c-k-c0x00ffffff-no-rj',17,79.00,85800,517,9894049,56,4.90,12.00,16.00,11.00,20.00,20.00,'',1,'2020-10-01 01:56:29','2020-10-01 01:56:29'),(18,'thatxxRin','https://www.youtube.com/c/thatxxrin/','Description\r\n\r\nHello and welcome! My name is Maureen and my channel is where I share my interests and life with you. It mainly focuses on beauty-related content, but at times I’d also share with you my other interests such as cooking, painting, crafts, fashion, singing, dancing and etc. Instead of seeing me as a “beauty youtuber” or “beauty guru”, I hope you’ll treat me as a friend who is sharing with you her experiences and opinions instead! ❤️\r\n\r\nI also have a blog if you love to read during your spare time: http://thatxxrin.blogspot.com','thatxxrin@gmail.com','','https://yt3.ggpht.com/a/AATXAJwxs5sFqi8PJGkhhyNnR8b4xhO9h3dxhRKtz7rikg=s88-c-k-c0x00ffffff-no-rj',10,81.00,15100,634,2101279,39,5.00,14.00,16.00,11.00,20.00,20.00,'',1,'2020-10-01 01:56:29','2020-10-01 01:56:29'),(1